import React from 'react'
import '../styles/Output.css'

const Output = props => {
    const handleBinaryMouseOver = event => {
        event.target.nextSibling.classList.remove('Hidden')
    }

    const handleBinaryMouseOut = event => {
        event.target.nextSibling.classList.add('Hidden')
    }



    let output = []

    for (let i = 0; i < props.binaryOutput.length; i++) {
        output.push(
            <div className='CompiledOutputWrapper' key={i} onMouseOver={handleBinaryMouseOver} onMouseOut={handleBinaryMouseOut} >
                <span className="BinaryOutput">{props.binaryOutput[i]}</span>
                <span className='CharOutput Hidden'>{props.charOutput[i]}</span>
            </div>
        )
    }

    return(
        <div className='OutputWrapper'>
            { output }
        </div>
    )
}

export default Output
